rule.algorithm:
LOCAL

      assemblies_of_parts: SET OF Assembly_component_relationship := [];

    END_LOCAL
;

LOCAL

  ndea_set : SET OF Effectivity_assignment := [];

END_LOCAL
;

  ndea_set := QUERY(ea <* Effectivity_assignment | 
	NOT('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.DATED_EFFECTIVITY' IN TYPEOF(ea.assigned_effectivity)));

function.algorithm:
LOCAL

      x : SET OF representation_relationship;

    END_LOCAL
;


    IF  relation.rep_1 IN  relatives THEN
      RETURN (FALSE);

    END_IF;

    x := QUERY(r <* bag_to_set(USEDIN(relation.rep_1, 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 'REPRESENTATION_RELATIONSHIP.' + 'REP_2'))| specific_relation IN TYPEOF(r));

    REPEAT i := 1 TO HIINDEX(x);

      IF NOT acyclic_representation_relationship(x[i], relatives + relation.rep_1, specific_relation)THEN
        RETURN (FALSE);

      END_IF;

    END_REPEAT;

    RETURN(TRUE);

LOCAL
      the_set : SET OF GENERIC : intype := [];
      i       : INTEGER;
    END_LOCAL;

    IF SIZEOF(the_bag) > 0 THEN
      REPEAT i := 1 TO HIINDEX(the_bag);
        the_set := the_set + the_bag[i];
      END_REPEAT;
    END_IF;
    RETURN(the_set);

LOCAL

      i  : INTEGER;

      td : length_measure := 0;

    END_LOCAL
;

    REPEAT i := 1 TO swsrh.segments;

      td := td + swsrh.segment_depths[i];

    END_REPEAT;

    RETURN(td);

IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.CLASS_CONDITION_ASSOCIATION' IN  TYPEOF(config.is_solution_for))THEN
  IF  config.configuration_type = configuration_kind.usage THEN
    RETURN(config.is_solution_for\Class_condition_association.condition_type ='part usage');

  ELSE
    RETURN(config.is_solution_for\Class_condition_association.condition_type ='design case');

  END_IF;

END_IF;


IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.CLASS_SPECIFICATION_ASSOCIATION' IN TYPEOF(config.is_solution_for))THEN
  IF config.configuration_type = configuration_kind.usage THEN
    RETURN(config.is_solution_for\Class_specification_association.association_type ='part usage');

  ELSE 
    RETURN(config.is_solution_for\Class_specification_association.association_type ='design case');

  END_IF;

END_IF;


RETURN(FALSE);

IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.ABSTRACT_VARIABLE' IN  TYPEOF(x))THEN  RETURN (TRUE);

      ELSE  IF(('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.FUNC' IN TYPEOF(X))AND
             (SIZEOF(QUERY(y <* x.terms | contains_variable(y)))> 0))
              THEN RETURN (TRUE);

              ELSE RETURN(FALSE);

           END_IF;

  END_IF;

LOCAL

      middle : SET  [1:?] OF  Independent_property;

      result : LIST [1:?] OF  Independent_property;

      links  : SET  [1:?] OF  Characteristic_data_table_header_link;

      temp   : Independent_property;

      precedent : SET  [0:?] OF  Characteristic_data_table_header_link;

      subsequent : SET [0:?] OF Characteristic_data_table_header_link;

    END_LOCAL
;

    -- Collect all headers
    links := bag_to_set(USEDIN(input, 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 'CHARACTERISTIC_DATA_TABLE_HEADER_LINK.TABLE'));

    -- Collect all Independent_properties
    REPEAT  i := 1 TO  HIINDEX(links);

      middle := middle + links[i]\Characteristic_data_table_header_link.precedent;

      middle := middle + links[i]\Characteristic_data_table_header_link.subsequent;

    END_REPEAT;

    result[1] := ?;

    -- Now need TO  construct the resulting list
    REPEAT  i := 1 TO  HIINDEX(middle);

      precedent := bag_to_set(QUERY(l <*(USEDIN(middle[i], 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 
        'CHARACTERISTIC_DATA_TABLE_HEADER_LINK.PRECEDENT'))| l.table = input));

      -- illegal chain
      IF (SIZEOF(precedent)> 1)THEN
        RETURN(?);

      END_IF;

      -- check IF  this is NOT last member
      IF (SIZEOF(precedent)= 1)THEN
        subsequent := bag_to_set(QUERY(l <*(USEDIN(middle[i], 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 
          'CHARACTERISTIC_DATA_TABLE_HEADER_LINK.SUBSEQUENT'))| l.table = input));

        -- we found first member
        IF (SIZEOF(subsequent)= 0)THEN
          result[1] := middle[i];

          ESCAPE;

        END_IF;

      END_IF;

    END_REPEAT;

    -- IF  there is no first member found yet - chain is broken
    IF (result[1] = ?)THEN
      RETURN (?);

    END_IF;

    temp := result[1];

    REPEAT i := 2 TO HIINDEX(middle);

      result[i] := precedent[1]\Characteristic_data_table_header_link.subsequent;

      precedent := bag_to_set(QUERY(l <*(USEDIN(result[i], 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 
        'CHARACTERISTIC_DATA_TABLE_HEADER_LINK.PRECEDENT'))| l.table = input));

      IF (HIINDEX(middle)= i)THEN
        ESCAPE;

      END_IF;

      -- illegal chain
      IF(SIZEOF(precedent)<> 1)THEN
        RETURN(?);

      END_IF;

    END_REPEAT;

    RETURN(result);

LOCAL

      dd : SET[0:?] OF  Document_definition := [];
  --this gives us access TO  the information base
      da : SET[0:?] OF Document_assignment :=[];

    END_LOCAL
;

    da := bag_to_set(QUERY(dr <* USEDIN(input, 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.'+
	  'DOCUMENT_ASSIGNMENT.IS_ASSIGNED_TO')|(dr.role = role)));

    -- iterate over da
    REPEAT i := 1 TO SIZEOF(da)BY 1;

      IF(type_name IN TYPEOF(da[i].assigned_document))THEN
        dd := dd + da[i].assigned_document;

      END_IF;

    END_REPEAT;

    RETURN(dd);

LOCAL

  sda : SET  OF  Shape_description_association := [];

  gm : SET OF Geometric_model := [];

 END_LOCAL
;


  sda := bag_to_set(USEDIN(input,
	 	'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 
	 	'SHAPE_DESCRIPTION_ASSOCIATION.' + 'REPRESENTED_CHARACTERISTIC'));


 REPEAT i := 1 TO SIZEOF(sda)BY 1;

  gm := gm + sda[i].representation;

 END_REPEAT;

 RETURN(gm);

LOCAL

      middle : BAG [0:?] OF Independent_property_relationship;

    END_LOCAL
;

      middle := QUERY(ipr <*(USEDIN(input, 'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 
        'INDEPENDENT_PROPERTY_RELATIONSHIP.RELATED'))| ipr.relation_type = 'decomposition');

      REPEAT i := 1 TO HIINDEX(middle);

        IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.CHARACTERISTIC_DATA_TABLE_HEADER' IN TYPEOF(middle[i].relating))THEN
          RETURN (middle[i].relating);

        END_IF;

      END_REPEAT;

      RETURN(?);

IF((((year MOD   4)= 0)AND 
      ((year MOD   100)<> 0))OR((year MOD 400)= 0))
        THEN 
          RETURN (TRUE);

        ELSE 
          RETURN(FALSE);

      END_IF ;

LOCAL
 i,j,k : INTEGER;
 END_LOCAL
;

  IF (('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.ABSTRACT_VARIABLE' IN  TYPEOF(thing))AND 
     ('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.RULE_DEFINITION' IN (TYPEOF(thing.scope))))
   THEN  accum := accum + thing;

   ELSE  IF ('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.RULE_CONDITION' IN  TYPEOF(thing))
        THEN  REPEAT  i := 1 TO  HIINDEX(thing\Atomic_formula.terms);

                accum := local_vars_aux(thing\Atomic_formula.terms[i],accum);

             END_REPEAT;

        ELSE  IF ('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.SIMPLE_CLAUSE' IN  TYPEOF(thing))
             THEN  REPEAT  j := 1 TO  HIINDEX(thing.formulas);

                        accum := local_vars_aux(thing.formulas[j],accum);

                  END_REPEAT;

             ELSE IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.COMPLEX_CLAUSE' IN TYPEOF(thing))
                  THEN REPEAT k := 1 TO HIINDEX(thing.clauses);

                        accum := local_vars_aux(thing.clauses[k],accum);

                       END_REPEAT;

                  END_IF;

             END_IF;

        END_IF;

  END_IF;

  RETURN(accum);

LOCAL

    accum : SET [0:?] OF Scalar_variable := [];

  END_LOCAL
;

  RETURN(local_vars_aux(thing, accum));

IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.VIEW_DEFINITION_USAGE'
      IN TYPEOF(input\Item_shape.described_element))
      THEN
        RETURN(input\Item_shape.described_element\View_definition_relationship.related_view);

    END_IF;

    IF('AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.PRODUCT_OCCURRENCE_DEFINITION_RELATIONSHIP' IN
        TYPEOF(input\Item_shape.described_element))
      THEN
        RETURN(input\Item_shape.described_element\Product_occurrence_definition_relationship.related_view);

    END_IF;

    RETURN(?);

LOCAL

  result: SET OF STRING:= [];

END_LOCAL
;


REPEAT i:=1 TO HIINDEX(items);

  result := result + TYPEOF(items[i]);

END_REPEAT;

RETURN(result);

LOCAL

 	category_assignments: BAG OF  Product_category_assignment;

 	categories: SET OF STRING:=[];

 	i: INTEGER;

 END_LOCAL
;


 category_assignments := USEDIN(obj,'AP203_CONFIGURATION_CONTROLLED_3D_DESIGN_OF_MECHANICAL_PARTS_AND_ASSEMBLIES_ARM_LF.' + 'PRODUCT_CATEGORY_ASSIGNMENT.PRODUCTS');


 REPEAT i := LOINDEX(category_assignments)TO HIINDEX(category_assignments)BY 1;

       categories := categories + category_assignments[i].category.name;

 END_REPEAT;


 RETURN(categories);

CASE rep.name OF
'document content': 
   BEGIN
RETURN(
  SIZEOF(QUERY(items <* rep\Representation.items | 
  NOT (items.name IN  ['detail level', 'geometry type', 'real world scale'])))= 0
);

   END;


'document creation': 
   BEGIN
IF NOT (SIZEOF(QUERY(items <* rep\Representation.items | 
  NOT (items.name IN  ['creating interface', 'creating system', 'operating system'])))= 0
)THEN
  RETURN(FALSE);

END_IF;

IF NOT (SIZEOF(QUERY(items <* rep\Representation.items | 
  NOT (items.name IN  ['creating system'])))= 1
)THEN
  RETURN(FALSE);

ELSE
  RETURN(TRUE);

END_IF;


   END;


'document format': 
   BEGIN
RETURN(
  SIZEOF(QUERY(items <* rep\Representation.items | 
  NOT (items.name IN  ['character code', 'data format', 'size format', 'size format standard'])))= 0
);

   END;


'document size': 
   BEGIN
RETURN(
  SIZEOF(QUERY(items <* rep\Representation.items | 
  NOT(items.name IN ['file size', 'page count'])))= 0
);

   END;


OTHERWISE:
  RETURN(UNKNOWN);

END_CASE;
